Berichten van het rune-protocol worden "runestones" genoemd. Het Runes-protocol wordt geactiveerd bij blok 840.000. Runestones in eerdere blokken worden genegeerd. In abstracte termen bevatten runestones de volgende velden: struct Runestone { edicts: Vec<Edict>, etching: Option<Etching>, mint: Option<RuneId>, pointer: Option<u32>,
} Runes worden gecreëerd door etchings: struct Etching { divisibility: Option<u8>, premine: Option<u128>, rune: Option<Rune>, spacers: Option<u32>, symbol: Option<char>, terms: Option<Terms>,
} Die mint-voorwaarden kunnen bevatten: struct Terms { amount: Option<u128>, cap: Option<u128>, height: (Option<u64>, Option<u64>), offset: (Option<u64>, Option<u64>),
} Runes worden overgedragen door middel van een edict: struct Edict { id: RuneId, amount: u128, output: u32,
} Rune-ID's worden gecodeerd als de blokhoogte en de transactie-index van de transactie waarin de rune werd geëtched: struct RuneId { block: u64, tx: u32,
} Rune-ID's worden in tekst weergegeven als BLOCK:TX. Rune-namen worden gecodeerd als gemodificeerde base-26 gehele getallen: struct Rune(u128);

